snippet.textDisplay:
WHAT. THE. HELL. Sahir Ali bagga!! Aima Baig. CokeStudio Pakistan = Talent ki dukaan. Both these good people are so much at ease! The tune didn't work for me but my god the houseband was on fire and what a beautifully arranged song. There were too many detours and it killed the mood but that said, what energy this man possesses! Bagga, eyes on you my man...liked the song for his energy, Aima's effortless singing and houseband...if only the tune was better. Good in pieces.

Love from India
@Rohwit

